css:
#status-bar-jumpy {
  color: #6494ed;
}
#status-bar-jumpy.no-match,
#status-bar-jumpy.no-match .status {
  color: #e2c08d;
}
.jumpy-label {
  color: #1d1f21;
  background: #a3a8ae;
  position: absolute;
  vertical-align: bottom;
  transform: translate(0, -100%);
  padding: .15em;
  border-radius: 3px;
  font-family: '.SFNSText-Regular', 'SF UI Text', 'Lucida Grande', 'Segoe UI', Ubuntu, Cantarell, sans-serif;
}
.jumpy-label.irrelevant {
  display: none;
}
.jumpy-label.high-contrast {
  background-color: #20b684;
}
.beacon {
  display: block;
  position: absolute;
  border-radius: 1px;
  width: 2px;
  height: 2px;
  z-index: -1;
  -webkit-animation: rip .085s;
  content: '';
}
@-webkit-keyframes rip {
  0% {
    box-shadow: 0 0 0 0 transparent,
                   0 0 0 0 transparent,
                   0 0 0 0 transparent,
                   0 0 0 0 transparent;
  }
  5% {
    box-shadow: 0 0 0 0 #d92626, 0 0 0 0 rgba(255, 255, 255, 0.5), 0 0 0 0 #d92626, 0 0 0 0 rgba(0, 0, 0, 0.1);
  }
  100% {
    box-shadow: 0 0 4px 24px #d92626, 0 0 0 0 transparent, 0 0 0 0 transparent, 0 0 0 0 transparent;
  }
}
